    false,nt"url": null,nt"notes": "Rugosity is derived from gridded (5 m cell
    size) multibeam bathymetry, collected aboard NOAA Ship Hiialaka'i and R/V AHI, and
    IKONOS derived depths using the Benthic Terrain Modeler with rugosity methods by
    Jeff Jenness (2003). Cell values reflect the surface area and (surface area) / (planimetric
    area) ratio for the area contained within that cell's boundaries. They provide indices
    of topographic roughness & convolutedness. This data set is for the bank top and
    lagoon environments of Pearl and Hermes Atoll, Hawaii, USA.",nt"owner_org":
